import React from "react";
// src/pages/index.js를 통해서 한번에 import 할 수 있도록 함
import MainTab from "../../../common/MainTab";
import TestImg from "../../../../test/image/img.png"
import {Container, GridList, GridListTile, Grid} from "@material-ui/core";

const ArtView = (props) => {
    const imgList = [
        {name: "a", img: TestImg},
        {name: "a", img: TestImg},
        {name: "a", img: TestImg},
        {name: "a", img: TestImg},
        {name: "a", img: TestImg},
        {name: "a", img: TestImg},
        {name: "a", img: TestImg},
        {name: "a", img: TestImg},
        {name: "a", img: TestImg},
        {name: "a", img: TestImg},
        {name: "a", img: TestImg},
        {name: "a", img: TestImg},
        {name: "a", img: TestImg}]
    return (
        <div>
            <MainTab history={props} tabValue="0"/>
                <Container maxWidth="lg" style={{marginTop: '200px', marginLeft: '20%'}}>

                    <GridList cellHeight="200px" cols={imgList.length} spacing={20} component="div">

                        {imgList && imgList.length > 0 && imgList.map((test, idx) => (
                            <GridListTile cols={1} rows={1} key={idx} style={{width: '150px'}}>

                                <Grid>
                                    <img src={test.img} style={{width: '150px', height: '150px'}}/>
                                </Grid>

                                <Grid style={{textAlign: 'center'}}>
                                    {test.name}
                                </Grid>
                            </GridListTile>
                        ))}
                    </GridList>
                </Container>
        </div>
    );
}

export default ArtView;
